exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper,hrefRecordRegex}=await require("transcode/parse_catalog");return parseCatalog(`http://www.ccbook.org/book/${bid}/`,{cleaner:html=>cleanCatalogWrapper(html,/id="ul_all_chapters"[^>]*>/,"</ul>"),recordRegex:hrefRecordRegex},{clientOptions:{...(options&&options.clientOptions)}})};